import React from 'react';
import TextInput from './components/TextInput';
import ImageInput from './components/ImageInput';

function Home() {
  return (
    <div>
      <header className="App-header">
        <p>Gifto</p>
        <TextInput/>
        <ImageInput/>
      </header>
    </div>
  );
}

export default Home;
